import React from "react"
import {BrowserRouter as Router,Switch, Route, Link} from "react-router-dom";

import "./Boxlink.css"

import Portfolio from "../Portfolio/Portfolio"

function Boxlink(props){
    let boxClass;
    if(props.box.shape == "square")
        boxClass = "boxlink__square"
    else if(props.box.shape == "rectangle")
        boxClass = "boxlink__rectangle"
    else
        boxClass = "boxlink__bar"

    return(
        <div className={boxClass}>
            <Router>
                <Link to="/Portfolio"> <h3>{props.box.case}</h3>  </Link>
                <Switch>
                    <Route path="/Portfolio">
                        <Portfolio />
                    </Route>
                </Switch>
            </Router>
        </div>
    )
}

export default Boxlink
